using Application.Common.FileStorage;
using Domain.Blog;
using Domain.Common;
using Infrastructure.FileStorage;
using Moq;
using NUnit.Framework;
using System.Threading;
using System.Threading.Tasks;

namespace Vitamin.Infrastructure.Tests
{
    public class Tests
    {
        private MockRepository _mockRepository;
        CancellationToken _cancellation;
        private Mock<LocalFileStorageService> _mockUploadFileStorage;


        [SetUp]
        public void SetUp() 
        {
            _mockRepository = new(MockBehavior.Default);
            _mockUploadFileStorage = _mockRepository.Create<LocalFileStorageService>();
            _cancellation = new CancellationToken();
        }
        private LocalFileStorageService uploadFileTest() {
                return _mockUploadFileStorage.Object;
        }
        [Test]
        public async Task UploadFile()
        {
            //D:\wwwroot\Vitamin\tests\Vitamin.Infrastructure.Tests\bin\Debug\net6.0\Files\Images\Post
            FileUploadRequest request = new FileUploadRequest()
            {
                Name = "hahah",
                Extension =".png",
                Data = "data:image/png;base64,"
            };
            var upload = uploadFileTest();
            var path=await upload.UploadAsync<Post>(request, FileType.Image, _cancellation);
            Assert.IsNotNull(path);

        }

    }
}